import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule } from '@angular/router'; // Importez RouterModule ici
import { AppComponent } from './app.component';
import { OffreComponent } from './offre/offre.component';
import { SidebarComponent } from './sidebar/sidebar.component';
import { SessionComponent } from './session/session.component';
import { AddsessionComponent } from './session/addsession/addsession.component';
import { UpdatesessionComponent } from './session/updatesession/updatesession.component';

const routes = [
  {path: 'offre', component: OffreComponent},
  {path: 'sidebar', component: SidebarComponent},
  {path: 'session', component: SessionComponent},
  {path: 'addsess', component: AddsessionComponent},
  {path: 'update-sess/:id', component: UpdatesessionComponent}
];

@NgModule({
  declarations: [
    AppComponent,
    OffreComponent,
    SidebarComponent,
    SessionComponent,
    AddsessionComponent,
    UpdatesessionComponent
  ],
  imports: [
    BrowserModule,
    RouterModule.forRoot(routes) // Ajoutez RouterModule.forRoot(routes) ici
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
